import styled from "styled-components";

export const ContainerPrincial = styled.div`
display: flex;
flex-direction: column;
align-items: center;
justify-content: center;
width: 400px;
margin: 100px auto;
padding: 50px;
background-color: black;
border-radius: 10px;
opacity: 0.2;


h1{ 
    padding: 20px;
}
`

export const ContainerInput = styled.div`
padding: 10px;
margin: 20px;
`
